import React from 'react'
import Image from '../../assets/slide-1.jpg'

const BackgroundImages = () => {

    const renderDiv = (extraClass) => {
        let item = [];
        for (let i = 0; i < 4; i++) {
          item.push(
            <div 
              key={ i }
            >
                <img src={Image}/>
            </div> 
          );
        }
        return item;
    };

    return (
        {renderDiv}
    )
}


export default BackgroundImages;
